import React, {Component} from 'react';
import MenuItem from '@material-ui/core/MenuItem';
import InputLabel from '@material-ui/core/MenuItem';
import Select from '@material-ui/core/Select';
import SelectControl from 'components/select-control'


const cuisineList = [
  { value: 1, label: `American` },
  { value: 2, label: `Asian` },
  { value: 3, label: `Bars` },
  { value: 4, label: `British` },
  { value: 5, label: `Burgers` },
  { value: 6, label: `French` },
  { value: 7, label: `Indian` },
  { value: 8, label: `Irish` },
  { value: 9, label: `Italian` },
  { value: 10, label: `Japanese` }
]


export default class SeatsPicker extends React.Component {
  state = {
    open: false,
    seats: ''
  };

  handleChange = event => {
    this.setState({ [event.target.name]: event.target.value });
  };


render() {

  return (
    <div>
        <SelectControl items = {seatsNumberList}/>
    </div>
  );
 }
};
